import React from 'react';
import './history.scss';


const History = (props) => {
  return (
    <div>
      <h3>History</h3>
      <section className="history">
        <ul>
          {Object.keys(props.history).map((item, i) => {
            return (
              <li key={i}>{item}</li>
            );
            })}
        </ul>
        <p>testing</p>
      </section>
    </div>
  )
}

export default History;
